import React, { Component } from 'react'


export default class App extends Component {
   constructor(){
     super()
     this.state = {
       display1:"block",
       display2:"block",
       display3:"block",
       display4:"block"
     }
     this.handlechange1 = this.handlechange1.bind(this)
     this.handlechange2 = this.handlechange2.bind(this)
     this.handlechange2 = this.handlechange3.bind(this)
     this.handlechange2 = this.handlechange4.bind(this)
   }
     handlechange1(){

        this.setState({
          display1:"none",
          display2:"block",
          display3:"block",
          display4:"block"
       })

     }

     handlechange2(){

      this.setState({
        display1:"block",
        display2:"none",
        display3:"block",
        display4:"block"
     })

   }


  render() {

    return (
      <div>

        <div style={{display:this.state.display1}} onClick={this.handlechange1}> <h1>hello 1</h1> </div>
        <div style={{display:this.state.display2}} onClick={this.handlechange2}> <h1>hello 2</h1> </div>
        <div style={{display:this.state.display3}}> <h1>hello 3</h1> </div>
        <div style={{display:this.state.display4}}> <h1>hello 4</h1> </div>


      </div>
    )
  }
}
